    static int findMaxConsecutiveOnes(int[] nums){
        int count = 0;
        int temp = 0;
        for(int i = 0;  i < nums.length; i++){
            if(nums[i] == 1){
                count++;
            }
            if(nums[i] == 0){
                if(count>temp){
                    temp = count;
                    count = 0;
                }
            }
        }
        if(count>temp) return count;
        else return temp;
    }
